import React, { Component } from 'react';
import {StyledSection, H2 , H3} from './style';

export default class JobMatcher extends Component {
   constructor(props) {
        super(props);
     this.state = {
     }
   }
   render() {
      return(
          <StyledSection>
              <H3>Job Matcher</H3>
              <H2>If you are a recruiter, write the name of your company to verify if my profile match with your projects</H2>
          </StyledSection>
      )
   }
}
